import React, { useState } from 'react';
import ReactDOM, { render } from 'react-dom';
import './index.css';
import ReactTable from "react-table-6";  
import "react-table-6/react-table.css"
import 'bootstrap/dist/css/bootstrap.css';
import { Collapse, Container, Navbar, NavbarBrand, NavbarToggler, NavItem, NavLink } from 'reactstrap';
import { Link } from 'react-router-dom';




function NavMenu(props){
  
  return (

    <header>
    <Navbar className="navbar-expand-sm navbar-toggleable-sm ng-white border-bottom box-shadow mb-3" light>
      <Container>
        <NavbarBrand tag={Link} to="/">Acme</NavbarBrand>
        

          <ul className="navbar-nav flex-grow">
            <NavItem>
              <NavLink tag={Link} className="text-dark" to="/">Home</NavLink>
            </NavItem>
            <NavItem>
              <NavLink tag={Link} className="text-dark" to="/counter">Product List</NavLink>
            </NavItem>
            <NavItem>
              <NavLink tag={Link} className="text-dark" to="/fetch-data">Student List</NavLink>
            </NavItem>
          </ul>
        
      </Container>
    </Navbar>
  </header>
  ) ;

}


ReactDOM.render(
  <div
    title="The GitHub Cards App"
  />,
  document.getElementById('root')
);
